package db.domain;public class UserEquipmentTeamImpl implements UserEquipmentTeam , 
						UserItem
					{	@Key	private String uname;	public static final int EQUIPMENT_TEAM_TYPE_ID_LEN = 10;	private int [] equipment_team_type_id = new int[10];	public UserEquipmentTeamImpl() {	}	public UserEquipmentTeamImpl(UserEquipmentTeam c) {		this.uname = c.getUname();		for (int i = 0; i < equipment_team_type_id.length; i++) {			equipment_team_type_id[i] = c.getEquipmentTeamTypeId(i);		}	}	@Override	public String tableName() {		return "user_equipment_team";	}	public void setUname(String uname) {		this.uname = uname;	}	public String getUname() {		return this.uname;	}public void addUname(String uname) {		this.uname += uname;}	public void setEquipmentTeamTypeId(int index, int value) {		this.equipment_team_type_id[index] = value;	}	public int getEquipmentTeamTypeId(int index) {		return this.equipment_team_type_id[index];	}}